import React, { useState } from "react";
import "./App.css";

import data from "./data/data.json";

interface dataProps {
  id: string;
  name: string;
  dni: string;
}

function App() {
  const [searchInput, setSearchInput] = useState("");
  const [foundCristi, setFoundCristi] = useState<dataProps[]>([
    { id: "", name: "", dni: "" },
  ]);

  const getDoctor = (dni: string) => {
    return dni;
  };

  console.log(foundCristi);

  const doctorSearch = () => {
    if (searchInput == null) return;
    const foundCristis = getDoctor(searchInput);
    setFoundCristi(foundCristi);
  };
  console.log("data", data);
  console.log("foundCristi", foundCristi);
  console.log("valueeee", searchInput);

  return (
    <div className="App">
      <header className="App-header"></header>
      <main>
        <form>
          <input
            type="search"
            onChange={(e) => setSearchInput(e.target.value)}
          />
          <button type="button" onClick={() => doctorSearch()}>
            Search
          </button>
        </form>
        <ul>
          {foundCristis.map((cris, index) => (
            <li key={index}>{cris.name}</li>
          ))}
        </ul>
      </main>
    </div>
  );
}

export default App;
